    false,nt"url": null,nt"notes": "Environmental Assessment for the proposed
    moist soil managment and wetland enhancement on the Funk Waterfowl Production Area
    (WPA) in the Rainwater Basin Wetland Management District.  Managing water effeciently
    on the Funk WPA is a major problem, which is causing the temporaary wetlands to
    become seveley choked with cattails. The proposed action is to enhance the wetland
    with water control structures.  This environmental assessment discusses alternatives
    considered, our proposed alternative, and the impacts associated with these alternatives.
